item.description:
}
            if (currentSum == sum - x) {
                maxPart = Math.max(maxPart, right - left);
            }
        }
        return maxPart == -1 ? -1 : nums.length - maxPart;
    }
}

}
            works[i] -= jobs[index];
            //不应该有人空闲
            if(works[i] == 0){
                break;
            }
        }
    }
}

res = Math.max(res, temp[j] * (n - j));
        }
        return res;
    }
}

ans[i] = ans[i] % mod;
                cn[j] = 0;
            }
        }
        return ans;
    }

public boolean checkPowersOfThree(int n) {
        while(n>0){
            if(n%3==2) return false;
            n /= 3;
        }
        return true;
    }
